import axios from "axios";
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import api from '../service/api';


export default function Home() {
  const [dogs, setDogs] = React.useState(null);
  const [breeds, setBreeds] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await api.get('breeds/list/all');
        // const data = await response.json();
        console.log('response', response)
        if (response) {
          setBreeds(Object.keys(response.data.message));
        } else {
          console.error('Erro ao buscar dados das raças: Resposta vazia ou inválida');
        }
      } catch (error) {
        console.error('Erro ao buscar dados das raças:', error);
      }
    };

    fetchData();
  }, []);

  const handleItemClick = (breed) => {
    // onItemClick(breed);
    console.log(breed);
  };


  return (
  <div style={{ flex: 1, flexDirection: 'row'}}>
    <div>
  <h2>Lista de Raças de Cachorro</h2>
    <ul>
      {breeds.map((breed, index) => (
        <li key={index}>
         <button onClick={() => handleItemClick(breed)}>{breed}</button>
        </li>
      ))}
    </ul>
    </div>
  </div>
  );
}
